import React from 'react';
import '../App.css';
import Form from "./Form";
import {useWeather} from "../Context/WeatherContext";
import Weather from "./Weather";
import {Col, Row} from "react-bootstrap";

function Container() {
    return (
        <div>
            <Container>
                <Row>
                    <Col>
                        <Form/>
                    </Col>
                </Row>
                <Row>
                    <Weather />
                </Row>
            </Container>

        </div>
    );
}

export default Container;
